import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element to be visible
    await page.waitForSelector('.cart');

    // Click on the cart to view items
    await page.click('.cart');

    // Wait for the cart items to load
    await page.waitForSelector('.cart-item');

    // Take a screenshot of the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_view.png'));

    // Remove the first item in the cart
    await page.click('.remove-item');

    // Wait for confirmation of item removal
    await page.waitForTimeout(1000); // Adjust as necessary for your application

    // Take a screenshot after item removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_removal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_removal.png'));

    // Check if the cart is empty or has items
    const cartCount = await page.$eval('.cart-count', el => el.textContent);
    const isCartEmpty = cartCount === '0';

    return {
      success: true,
      action: isCartEmpty ? "Item removed from cart, cart is now empty" : "Item removed from cart",
      extractedData: { cartCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
